INSERT INTO `noticias` VALUES (1,'Gran victoria del Club Yerbalito en el torneo local','El pasado fin de semana, nuestro equipo logro una importante victoria por 3-1 frente al Club Rival en el estadio municipal. Los goles fueron anotados por Juan Pérez (2) y Carlos Rodríguez (1), consolidando nuestra posición en la tabla de posiciones.\n\nEste triunfo es resultado del gran trabajo en equipo y la dedicación de todos los jugadores durante las semanas de entrenamiento. El técnico destaca el compromiso y la actitud positiva del plantel.\n\n¡Felicitaciones a todo el equipo! Continuamos trabajando para alcanzar nuestros objetivos en esta temporada.','2025-10-28 19:58:13','2025-10-31 16:43:03','Comisin Directiva',NULL,1),(2,'Inscripciones abiertas para la temporada 2025','El Club Yerbalito informa que se encuentran abiertas las inscripciones para todas las categorías de la temporada 2025. Las inscripciones están disponibles hasta el 15 de febrero.\n\nCategorías disponibles:\n\n- Masculino: \n- ABEJAS (nacidos en el 2019) \nGRILLOS (2018)\nCHATAS (2017) \nCHURRINCHES (2016) \nGORRIONES (2015) \nSEMILLAS (2014) \nCEBOLLAS (2013) \nBABYS (2012)\n\n- Femenino: \nSUB9 (2016-2018) \nSUB11 (2014-2015) \nSUB13 (2012-2013)\n\nLos interesados pueden acercarse a la sede del club de lunes a viernes de 18:00 a 20:00 horas, o contactarnos a través de  nuestras redes sociales.\n\nRequisitos:\n- Fotocopia de cédula \n- Certificado médico\n- 2 fotos carnet\n\n¡Los esperamos para ser parte de la gran familia del Yerbalito!','2025-10-28 19:58:21','2025-10-31 16:42:11','Secretaria',NULL,1),(3,'Noticia 2','Contenido de la noticia 2','2025-11-01 01:02:54','2025-11-01 01:02:54','Pedro El Escamoso',NULL,1);
/*!40000 ALTER TABLE `noticias` ENABLE KEYS */;
UNLOCK TABLES;

